import React from "react";
import Todo from "./Todo";
import { MdDelete, MdEdit, MdCheckCircle } from "react-icons/md";
const TodoList = ({ todos, setTodos }) => {
  return (
    <div>
      {todos.map((todo) => {
        return (
          <ul key={todo.id}>
            <li>
              <Todo todo={todo} />

              <button>
                <MdDelete />
              </button>
              <button>
                <MdEdit />
              </button>
              <button>
                <MdCheckCircle />
              </button>
            </li>
          </ul>
        );
      })}
      <div></div>
    </div>
  );
};

export default TodoList;
